window.bookSummaryJSON = "<p><b>No rules. No laws. No mercy. She belongs to them now.</b></p> <p>An Earth member of the medical recovery team on Transport Station Zenith, Harper meets two mysterious strangers from an unknown world. With intense eyes and even more intense desires, it’s easy for the two sexy-as-sin aliens to prove how good it can be with them.</p> <p>Styx, a leader from Rogue 5, knows Harper is destined to belong to him and his most trusted enforcer, Blade. But when Styx is betrayed by one of his own kind, she’s caught in the deadly crossfire. Harper’s mates must tread carefully, for even if they win the battle on the lawless outer moon, they might lose the most important battle of all - the one for her heart.</p>"; 
